    false,nt"url": null,nt"notes": "The U.S. Fish and Wildlife Service conducted
    this study because of the possibility that DDTM (DDT and its metabolites) and other
    organochlorine pesticides were above concern levels in fish and aquatic-oriented
    wildlife occurring on the Morgan Brake National Wildlife Refuge. Another objective
    of the study was to determine if endocrine disruption was occurring in fish and
    other aquatic oriented wildlife. Sixty five percent of the twenty fish samples contained
    DDTM concentrations above the predator protection level of 1.0 ppm. One fish sample
    contained DDTM concentrations that exceeded the Food and Drug Administration action
    level of 5.0 ppm. Toxaphene concentrations detected in fish are of more concern
    than DDTM concentrations in fish. All but one of the fish samples contained toxaphene
    levels above the recommended limit for the protection of fish eating wildlife. The
    whole body DDTM and toxaphene levels for this study are also of sufficient magnitude
    to be of potential concern to human consumers, which would consume fish fillets
    only. The Mississippi Department of Environmental Quality has agreed to collect
    fillets from fish on the refuge to determine if a fish consumption advisory is warranted.
    DDTM and toxaphene concentrations were well below concern levels in raccoon tissue
    samples. Analyses of the fish and raccoon blood plasma indicated that endocrine
    disruption was not a problem on the refuge. Endocrine disruption was observed in
    only one of the fish blood samples and none of the raccoon blood samples. The histological
    evaluations of fish gonads indicated that fish were in good reproductive health.
    Recommendations are provided in the report to address problems and concerns identified
    by this investigation.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
